import React from 'react';
import "./SignUpPage.css";

const SignUpPage = () => {
  return (
    <div className="signuppage">
      <div className="div8">회원가입</div>
      <div className="div9">{`운동뭉치의 다양한 서비스를 경험해보세요 `}</div>
      <div className="signuppage-child" />
      <div className="signuppage-item" />
      <div className="signuppage-inner" />
      <div className="signuppage-child1" />
      <div className="signuppage-child2" />
      <div className="signuppage-child3" />
      <div className="signuppage-child4" />
      <div className="signuppage-child5" />
      <div className="div10">{`중복확인 `}</div>
      <div className="div11">{`간편 회원가입 `}</div>
      <div className="signuppage-child6" />
      <img className="kakao-login-1-icon" alt="" src="/kakao-login-1@2x.png" />
      <div className="div12">{`가입하기 `}</div>
      <input type="text" className="div13" placeholder="이름" />
      <input type="text" className="div14" placeholder="닉네임" />
      <input type="text" className="div15" placeholder="아이디" />
      <input type="password" className="div16" placeholder="비밀번호" />
      <input type="password" className="div17" placeholder="비밀번호 확인" />
    </div>
  );
};

export default SignUpPage;
